import React, { Component } from 'react';
import './Calc.css'

export default class Calculator extends Component {
    constructor(props){
        super(props);
        this.state={

        }

           
    }
  
      
    
    render() {
        return (
           <div className='calculator'>    
               <input type="text" placeholder='0' className='input' />
               <button className='keyButton'>0</button>
               <button className='keyButton'>1</button>
               <button className='keyButton'>2</button>
               <button className='keyButton'>3</button>
               <button className='keyButton'>4</button>
               <button className='keyButton'>5</button>
               <button className='keyButton'>6</button>
               <button className='keyButton'>7</button>
               <button className='keyButton'>8</button>
               <button className='keyButton'>9</button>
               <button className='mathButton'>+</button>
               <button className='mathButton'>-</button>
               <button className='mathButton'>*</button>
               <button className='mathButton'>/</button>
               <button className='actionButton'>=</button>
               <button className='actionButton'>Clear</button>
           </div>
        )
    }
}
